"use strict";var load=function(){$.ajaxSetup({beforeSend:function(a){console.log("before send");var e="JWT "+window.localStorage.getItem("token");console.log(e),a.setRequestHeader("Authorization",e)}}),$.ajax({url:"https://super-nurse.herokuapp.com/patients",action:"GET",context:document.body,crossDomain:!0,success:function(a){for(var e=0;e<a.length;e++)$("#patients").append('<div class="card-wrapper">\n                    <a class="card-link row" href="patient-profile.html?id='+a[e]._id+'">\n                        <div class="image-wraper col-6 col-sm-12">\n                            <img src="./images/senior-placeholder.jpg" alt="" class="img-fluid">\n                        </div>\n                        <div class="content col-6 col-sm-12">\n                            <p id="FullNameID" class="name subheading">'+a[e].first_name+" "+a[e].last_name+'</p>\n                            <div class="details">\n                                <div class="details-row">\n                                    <p class="details-label">DOB: </p>\n                                    <p class="details-value">'+a[e].date_of_birth+'</p>\n                                </div>\n                                <div class="details-row">\n                                    <p class="details-label">Room: </p>\n                                    <p class="details-value">'+a[e].room+"</p>\n                                </div>\n                            </div>\n                        </div>\n                    </a>\n                </div>")}}).fail(function(){$("#patients").html("error")})},searchPatient=function(){var s=$("#search-input").val();$(".card-wrapper").each(function(a,e){e.querySelector("#FullNameID").innerHTML.includes(s)?e.style.display="block":e.style.display="none"})};